css:
@-moz-document domain(tumblr.com) {
body {



  background:url("http://4.bp.blogspot.com/_tz4S86M3ZdA/TDjWz0dODeI/AAAAAAAAATg/zQKdaHR5inE/s1600/0+(8).jpg") no-repeat fixed !important;



  background-color: transparent !important;



  background-position: 0% 0% !important;



  background-size: 100% 100%  !important;



}


#left_column, #right_column {background-color: transparent !important;}

div.l-content.l-content.l-content {



  background: transparent !important;



}



 
#posts LI[class*=" post"] {



  background: rgba(255, 255, 255, 1.0) !important;



}

.post.photo_post .photo, .post.photo_post .video_thumbnail {

  -moz-box-shadow: 1px 1px 3px rgba(0, 0, 0, 0.0) !important;







  border-radius: 12px !important;







}







.content.is_media, .mask.top, .mask.bottom {







  background: none !important;







}

























.mceContentBody {



  color: rgba(0, 0, 0, 1.0) !important;



  background: rgba(255,255,255, .50) !important;



}

/* Code repaired by admin. See http://forum.userstyles.org/discussion/37591/attempting-to-mass-fix-broken-tumblr-dash-icon-styles */
.new_post {
	background: #ffffff url('http://i43.tinypic.com/15816y0.jpg') center center no-repeat !important;
}
.new_post_label_icon {
	background-image: none !important;
}
































}
